        private void DoChoosePicture()
        {
            try
            {
                //clearRegistrationInfo();
                _pictureChooserTask = Mvx.Resolve<IMvxPictureChooserTask>();
                _pictureChooserTask.ChoosePictureFromLibrary(1000, 100, OnPicture, () => { });
            }
            catch (Exception)
