        private void OnPicture(System.IO.Stream pictureStream)
        {


            var memoryStream = new MemoryStream();


            String base64Image = "";
            try
            {
                pictureStream.CopyTo(memoryStream);
                _bytes = memoryStream.ToArray();

                base64Image = "data:image/jpeg;base64," + Convert.ToBase64String(_bytes);

                //scanReg(base64Image);
                scanRegistration(base64Image);
            }
            catch (ArgumentNullException)
            {
                //WarningType = "Внимание";
                //WarningMessage = "Неправилен формат на изображението.";
                //stopLoading();
            }

            //stopLoading();
        }


        void scanRegistration(String base64Image)
        {


            var client = new RestClient(new Uri(Constants.OCR_API_ENDPOINT));
            
                try
                {
                    var request = new RestRequest(Method.POST);

                    request.AddHeader("apikey", Constants.OCR_API_KEY);
                    request.AddParameter("base64Image", base64Image, ParameterType.GetOrPost);
                    request.AddParameter("language", "bul", ParameterType.GetOrPost);


                var asyncHandle = client.ExecuteAsync<OCRSpaceResponse>(request, response => {
                    Console.WriteLine(response.Content);

                    if (response.Data.IsErroredOnProcessing == true)
                    {
                        //WarningType = "Внимание";
                        //WarningMessage = "Възникнаха грешки при обработката на изображението.";
                        //stopLoading();
                        return;
                    }

                    if (response.Data.ParsedResults.Count > 0)
                    {
                        switch (response.Data.ParsedResults.ElementAt(0).FileParseExitCode)
                        {
                            case 0:
                                //WarningType = "Внимание";
                                //WarningMessage = "Файлът не беше открит.";
                                //stopLoading();
                                return;
                            case -10:
                            case -20:
                            case -30:
                            case -99:
                                //WarningType = "Внимание";
                                //WarningMessage = "Възникна проблем при анализирането на изображението.";
                                //stopLoading();
                                return;
                        }

                        //Parsed text
                        string numText = response.Data.ParsedResults.ElementAt(0).ParsedText;
                        RegNumOCRValidator.validate(ref numText);
                        //RegNum = numText;
                        EditText regNum = FindViewById<EditText>(Resource.Id.reg_num_txt);
                        regNum.Text = numText;


                    }


                });

                }
                catch (Exception e)
                {


                }


            }



